  const [isSignup, setIsSignup] = useState(false)
  return (
    <section class='auth-section'>
      <div class='auth-container'>
        {!isSignup && <img sre={icon} alt='stack overflow' className='login-logo' />}
        <form>
          <label htmlFor=''>
            <h4>Emai;</h4>

          </label>
        </form>

      </div>

    </section>
  )
}

export default Auth
